import React from 'react';

function App() {
  return (
    <div>
      <header style={{ backgroundColor: 'rgb(12, 122, 240)' }}>
        <h1>Osiris</h1>
      </header>
      <body>
      <ul>
        <li><a href="/api/applicants">Link to API</a></li>
      </ul>
      </body>
    </div>
  );
}

export default App;
